package golang

import "testing"

func Test_longestDupSubstring(t *testing.T) {
	type args struct {
		S string
	}
	tests := []struct {
		name string
		args args
		want string
	}{
		{
			name: "e1",
			args: args{
				S: "banana",
			},
			want: "ana",
		},
		{
			name: "wa1",
			args: args{
				S: "",
			},
			want: "mqqqv",
		},
		{
			name: "wa2",
			args: args{
				S: "",
			},
			want: "aeeebaabd",
		},
		{
			name: "wa3",
			args: args{
				S: "",
			},
			want: "",
		},
		{
			name: "wa4",
			args: args{
				S: "",
			},
			want: "",
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := longestDupSubstring(tt.args.S); got != tt.want {
				t.Errorf("(len(s)=%d)longestDupSubstring() = (len=%d) %v, \nwant(len=%d) %v", len(tt.args.S), len(got), got, len(tt.want), tt.want)
			}
		})
	}
}
